import React from 'react'
import DataTable from './DataRow'

const ViewData = ({ data }) => {

  const monthlyFarmData = data.filter()
  const pH = monthlyFarmData.filter()
  const rainFall = monthlyFarmData.filter()
  const temperature = monthlyFarmData.filter()

  return (
    <>
      <DataTable filteredData={pH}/>
      <DataTable filteredData={rainFall}/>
      <DataTable filteredData={temperature}/>
    </>
  )

}

export default ViewData
